import React, { Component } from 'react'
import { FaInstagram, FaMailBulk, FaLinkedinIn, FaTwitter} from "react-icons/fa"
import configs from '../../../configs.json'

class Services extends Component {
    constructor(props) {
        super(props)
        this.state = {
            highlight: this.props.highlight
        }
    } 
    render() {
        return (
            <div className='container' style={{backgroundColor: this.state.highlight }}>
                <div className='row section-row'>
                <h3 className='orange-text'>Marcas</h3>
                    <h6>Conheca nossas marcas</h6>
                    <br></br>
                    {process.env.REACT_APP_SERVICES.split('|').map(t =>
                        <div className='col s4'>
                            <div className='card-panel grey lighten-5'>
                                <img style={{border:'4px solid'+process.env.REACT_APP_COLORS_LIGHTER}} src={require("../../../static/imgs/ark-white-combined.png")} alt="" class="responsive-img service-img"/>
                                <h5><a href='/' style={{color:'orange'}}>{t.split(',')[0]}</a></h5>
                                <h6 style={{color: 'black'}}>{t.split(',')[1]}</h6>
                                <FaInstagram  className='social-icon' style={{color:process.env.REACT_APP_COLORS_DARKER}} />
                                <FaMailBulk   className='social-icon' style={{color:process.env.REACT_APP_COLORS_DARKER}} />
                                <FaLinkedinIn className='social-icon' style={{color:process.env.REACT_APP_COLORS_DARKER}} />
                                <FaTwitter    className='social-icon' style={{color:process.env.REACT_APP_COLORS_DARKER}}/>
                            </div>
                        </div>
                    )}
                </div>
            </div>
        )
    }
}

export default Services
